      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE ( col1 ) NOT BETWEEN - col0 + + 63 + col1 + - col2 * - + ( col2 ) * - 16 AND + 3;
  - name: tab0

outputs:
